import React from 'react';
import temple from '../img/temple-mini.png'

const style = {
    color: '#ffffff',
    backgroundColor: '#9e3500',
    backgroundImage: `url(${temple})`,
    backgroundSize: '80%',
    backgroundRepeat: 'no-repeat',
    minHeight: '574px',
    maxHeight: '574px',
};

export default function Home() {
    return (
        <div style={style}>
            My First React Component!
        </div>
    );
}
